import React from "react";
import '../stylesheets/MyProjects.css'

const FCCCertifications = [
  {
    name: 'Responsive Web Design Certification',
    image: '../images/FFC Responsive Web Design.png',
    url: 'https://freecodecamp.org/certification/Dekkvar/responsive-web-design'
  },{
    name: 'JavaScript Algorithms and Data Structures Certification',
    image: '../images/FFC JavaScript Algorithms and Data Structures.png',
    url: 'https://freecodecamp.org/certification/Dekkvar/javascript-algorithms-and-data-structures'
  },{
    name: 'Front End Development Libraries Certification',
    image: '../images/FFC Front End Development Libraries.png',
    url: 'https://freecodecamp.org/certification/Dekkvar/front-end-development-libraries'
  }
]


class MyProjects extends React.Component {
  constructor() {
    super();
    this.state={
      folder: 'allprojects'
    }
  }
  render() {
    return (
      <div className='myprojects-container'>
        <h2>My proyects</h2>
        <div className='folders-container'>
          <FoldersButton>FreeCodeCamp Certifications</FoldersButton>
          <FoldersButton>Other Projects</FoldersButton>
        </div>
        <div>
          <ProjectsView alt='Calculator img'>Calculator React</ProjectsView>
        </div>
      </div>
    )
  }
}
  

function FoldersButton(props) {
  return(
    <button className='foldersButton'>{props.children}</button>
  )
}

function ProjectsView(props) {
  return(
    <div className='projectsView-container'>
      <img alt={props.alt}></img>
      <div className='project-title'>{props.children}</div>
    </div>
  )
}



function FreeCodeCampCertification() {
  return(
    <div className='projectsView-container'>
      <img alt=''></img>
      <div className='freeCodeCamp-certification'></div>
    </div>
  )
}


export default MyProjects;
